import { Box, } from '@mui/material'


const RightBar = () => {
  return (
    <Box flex={3} sx={{
        display:{
            xs:"none",
            sm:"block"
        }
    }}>
      <Box position="fixed">
        <Typography>Hello</Typography>
      </Box>
    </Box>
  )
}

export default RightBar
